import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import './Navbar.css';
import logo from '../../assets/LOGO.png';
import { Search } from 'lucide-react';

const Navbar = () => {
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [isSearchOpen, setIsSearchOpen] = useState(false);
  const [searchQuery, setSearchQuery] = useState('');
  const [searchResults, setSearchResults] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    const checkAuthentication = () => {
      const token = localStorage.getItem('token');
      setIsAuthenticated(!!token);
    };

    checkAuthentication();
    window.addEventListener('storage', checkAuthentication);

    return () => {
      window.removeEventListener('storage', checkAuthentication);
    };
  }, []);

  const signOut = () => {
    localStorage.removeItem('token');
    localStorage.removeItem('user');
    setIsAuthenticated(false);
    navigate('/login');
  };

  const toggleSearch = () => {
    setIsSearchOpen(!isSearchOpen);
    if (!isSearchOpen) {
      setSearchQuery('');
      setSearchResults([]);
    }
  };

  const handleSearchChange = async (e) => {
    const query = e.target.value;
    setSearchQuery(query);

    if (query.length > 2) {
      try {
        const response = await fetch(`/api/search?q=${query}`);
        const data = await response.json();
        setSearchResults(data);
      } catch (error) {
        console.error('Error fetching search results:', error);
      }
    } else {
      setSearchResults([]);
    }
  };

  return (
    <nav className="navbar">
      <div className="navbar-container">
        <Link to="/" className="navbar-logo">
          <img src={logo} alt="Voyaige" />
          <span>Voyaige</span>
        </Link>
        <ul className="navbar-menu">
          <li><Link to="/">Home</Link></li>
          <li><Link to="/tours">Tours</Link></li>
          <li><Link to="/hotels">Hotels</Link></li>
          <li><Link to="/eat-and-drink">Eat & Drink</Link></li>
        </ul>
        <div className="navbar-actions">
          <button onClick={toggleSearch} className="search-button">
            <Search size={24} />
          </button>
          {isAuthenticated ? (
            <button onClick={signOut} className="auth-button">Log Out</button>
          ) : (
            <Link to="/login" className="auth-button">Sign In</Link>
          )}
        </div>
      </div>
      {isSearchOpen && (
        <div className="search-overlay">
          <input
            type="text"
            placeholder="Search for cities, hotels, or attractions"
            value={searchQuery}
            onChange={handleSearchChange}
          />
          {searchResults.length > 0 && (
            <div className="search-results">
              <div className="results-section">
                <h3>Hotels</h3>
                <ul>
                  {searchResults.hotels.slice(0, 3).map((hotel) => (
                    <li key={hotel._id}>{hotel.name}</li>
                  ))}
                </ul>
              </div>
              <div className="results-section">
                <h3>Top Destinations</h3>
                <ul>
                  {searchResults.destinations.slice(0, 3).map((destination) => (
                    <li key={destination._id}>{destination.name}</li>
                  ))}
                </ul>
              </div>
            </div>
          )}
        </div>
      )}
    </nav>
  );
};

export default Navbar;
